import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "../../assets/css/home.css";

const Home = () => {
  return (
    <div className="home">
      <div className="container_home">
        <h1>Welcome to My Blog</h1>
      </div>
    </div>
  );
};

export default Home;
